import { npmDeps } from "./npm_deps.js";
import { krellNpmDeps } from "./krell_npm_deps.js";
import { assets } from "./krell_assets.js";

var METRO_IP = "192.168.0.26";
var METRO_PORT = 8081;

const evaluate = eval;

global.CLOSURE_BASE_PATH = "target/goog/";
global.CLOSURE_NO_DEPS = true;

var loadQueue = [];
var isLoading = false;
var libLoadListeners = {};

const notifyListeners = (path) => {
    let xs = libLoadListeners[path] || [];
    xs.forEach(function (x) {
        x();
    });
    libLoadListeners[path] = [];
};

const onSourceLoad = (path, cb) => {
    if(typeof libLoadListeners[path] === "undefined") {
        libLoadListeners[path] = [];
    }
    libLoadListeners[path].push(cb);
};

const loadFile = (path) => {
    let url = "http://" + METRO_IP + ":" + METRO_PORT + "/" + path;
    return fetch(url)
        .then(response => response.text())
        .then(function(source) {
            try {
                evaluate(source);
                setTimeout(() => notifyListeners(path), 0);
            } catch(err) {
                console.error("Could not evaluate", url, err);
            }
        })
        .catch(function(err) {
            console.error("Could not load", url, err);
        });
};

const loadPending = async () => {
    for(;;) {
        if(loadQueue.length === 0) {
            break;
        }
        let next = loadQueue.shift();
        await loadFile(next);
    }
    isLoading = false;
};

const queueLoad = (path) => {
    loadQueue.push(path);
    if(!isLoading) {
        isLoading = true;
        setTimeout(loadPending, 250);
    }
};

